import React, { Component } from 'react'
import { Table } from 'antd'



export default class PermissonList extends Component {


    state = (
        {
            columns: [
                {
                    title: '姓名',
                    dataIndex: 'name',//与dataSource中的字段对应
                    key: 'name',
                },
                {
                    title: '年龄',
                    dataIndex: 'age',
                    key: 'age',
                },
                {
                    title: '住址',
                    dataIndex: 'address',
                    key: 'address',
                },
            ]
        },
        {
            dataSource: [
                {
                    key: '1',
                    name: '胡彦斌',
                    age: 32,
                    address: '西湖区湖底公园1号',
                },
                {
                    key: '2',
                    name: '胡彦祖',
                    age: 42,
                    address: '西湖区湖底公园1号',
                },
            ]

        })
    render() {
        return (
            <div>
                PermissonList
                <Table dataSource={this.state.dataSource} columns={this.state.columns} />
            </div>
        )
    }
}
